import ExpenseItem from "./components/ExpenseItem";
import ExpenseDate from "./components/ExpenseDate";

function App() {
  //Arreglo de objetos tipo expenses
  const expenses=[
    {id:"e1" ,title:"Car Insurance", amount:294.67,date: new Date(2000,9,13)},
    {id:"e2",title:"Gym", amount:500.00,date: new Date(2000,10,18)},
    {id:"e3",title:"Steam", amount:1600,date: new Date(2000,11,4)},
    {id:"e4",title:"Netflix", amount:100,date: new Date(2000,11,8)}
  ];
  //Se paso como argumento
  return (
    <div>
      <h2>Let's get started!</h2>

        <ExpenseDate title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}/>
        <ExpenseDate title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}/>
        <ExpenseDate title={expenses[2].title} amount={expenses[2].amount} date={expenses[2].date}/>
        <ExpenseDate title={expenses[3].title} amount={expenses[3].amount} date={expenses[3].date}/>

    </div>
  );
}

export default App;
